(function(){Application.controller("HomeController",["$scope","$http",function(n,t){n.Manuals=[];t({method:"GET",url:"/Home/GetManuals"}).success(function(t){n.Manuals=t});n.Tags=[];t({method:"GET",url:"/Home/GetTags"}).success(function(t){n.Tags=t;n.words=[];angular.forEach(t,function(t){n.words.push({text:t.Name,weight:1,link:"http://google.com"})})});n.colors=["#800026","#bd0026","#e31a1c","#fc4e2a","#fd8d3c","#feb24c","#fed976"];n.update=function(){n.words.splice(-5)}}])}).call(this);